import React from 'react';
import '../clouds.css';

const Clouds = ({ numberOfClouds }) => (
    <div id="background-wrap">
        {Array.from({length: numberOfClouds}, (_, i) => (
            <div key={i}>
                <div className={`cloud cloud-animation cloud-animation--fast`} />
            </div>
        ))}
    </div>
);

export default Clouds;
